import React from "react";
import Card from './Card';


const CardList = ({ robots }) => {
    const cardsArray = robots.map((user, id) => {
        return (
            <Card 
                key={id} 
                id={robots[i].id} 
                name={robots[i].name} 
                handle={robots[i].handle}
            />
        );
    })
    return (
        <div>
            {cardsArray}
        </div>
    );
}

export default CardList;
